-- Table structure for website_order
-- ----------------------------
DROP TABLE IF EXISTS `website_order`;
CREATE TABLE `website_order` (
  `id` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `orderNum` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '订单号',
  `productName` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '产品名称',
  `productTag` int(6) NOT NULL COMMENT '产品规格',
  `productTotal` int(6) NOT NULL COMMENT '产品价格',
  `productPurchaser` varchar(4) COLLATE utf8_bin DEFAULT NULL COMMENT '购买联系人',
  `productPhone` varchar(11) COLLATE utf8_bin DEFAULT NULL COMMENT '联系人电话',
  `paymentStatus` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '支付状态 ‘0’ 未支付 ‘1’ 已支付',
  `paymentMethod` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '支付方式 ‘0’ 支付宝 ‘1’ 微信 ‘2’ 银联个人 ‘3’ 银联企业',
  `paymentTime` datetime DEFAULT NULL COMMENT '支付完成时间',
  `orderTime` datetime DEFAULT NULL COMMENT '订单生成时间',
  `optionName` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '操作人姓名',
  `optiionTime` datetime DEFAULT NULL COMMENT '操作时间',
  `receivingMethod` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '收货方式 ‘0’邮件 ‘1’ U盘邮寄 ‘2’ 光盘邮寄',
  `receivingAddress` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `receivingName` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '收货人姓名',
  `receivingPhone` varchar(11) COLLATE utf8_bin DEFAULT NULL COMMENT '收货人手机号',
  `receivingStatus` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '发货状态 ‘1’已发货 ‘0’未发货',
  `sender` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '快递寄件人',
  `expressCompanyName` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '快递公司名称',
  `expressNum` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '快递编号',
  `expressOutTime` datetime DEFAULT NULL COMMENT '快递寄出时间',
  `remarks` varchar(255) CHARACTER SET utf8 COLLATE utf8_romanian_ci DEFAULT NULL COMMENT '备注',
  `alipayNo` varchar(28) COLLATE utf8_bin DEFAULT NULL COMMENT '支付宝订单号',
  PRIMARY KEY (`orderNum`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

